import React from "react";
import Item from "./Item";

export default function List(props) {
  const styles = {
    ul: [(listStyle = "none")],
  };
  return (
    <ul style={styles.ul}>
      {props.todos.map((todo, index) => {
        return <Item todo={todo} key={todo.id} index={index}></Item>;
      })}
    </ul>
  );
}
